  [],\n\t\"revision_timestamp\": \"2016-05-25T00:20:16.018553\",\n\t\"name\": \"pre-employment-screening-program-psp\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The program helps motor carriers make more
  informed hiring decisions by providing electronic access to driver crash and inspection
  history from the FMCSA Motor Carrier Management Information System (MCMIS). PSP
  records are now available for motor carriers and commercial drivers.  PSP is designed
  to assist the motor carrier industry in assessing individual operator crash and
  serious safety violation history as a pre-employment condition. A carrier will pay
  $10 for each requested driver history. An annual subscription fee of $100 also applies.
  Carriers with fewer than 100 power units qualify for a discounted annual fee of
  $25 per year.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
